import React from 'react'
import '../css/Recipe.css'
const Recipe = ({recipe}) => {
    return (
        <div className="recipe">
            <img src={recipe.image} alt={recipe.title } />
            <h3>{recipe.title}</h3>
        </div>
    )
}

export default Recipe
